import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Line } from 'react-chartjs-2';
import Header from '../components/Header';

const RevenueAnalytics = () => {
  const [analyticsData, setAnalyticsData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    fetchRevenueData();
  }, []);

  const fetchRevenueData = async () => {
    try {
      const response = await axios.get('http://localhost:5000/api/analytics/revenue', {
        headers: { Authorization: `Bearer ${localStorage.getItem('token')}` }
      });
      setAnalyticsData(response.data);
    } catch (error) {
      console.error('Error fetching revenue data:', error);
      setError('Failed to fetch revenue data. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const chartOptions = {
    responsive: true,
    plugins: {
      legend: {
        position: 'top',
      },
      title: {
        display: true,
        text: 'Revenue Over Time',
      },
    },
  };

  return (
    <div className="min-h-screen bg-background text-text">
      <Header />
      <main className="max-w-7xl mx-auto py-6 sm:px-6 lg:px-8">
        <h1 className="text-3xl font-bold mb-6">Revenue Analytics</h1>
        {loading ? (
          <p>Loading data...</p>
        ) : error ? (
          <p className="text-red-500">{error}</p>
        ) : analyticsData ? (
          <div className="bg-surface p-6 rounded-lg shadow-lg">
            <Line data={analyticsData} options={chartOptions} />
          </div>
        ) : (
          <p>No data available.</p>
        )}
      </main>
    </div>
  );
};

export default RevenueAnalytics;
